import Link from 'next/link';
import List from '../boards/List';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about" as="about" route={List}>
      <a style={linkStyle}>About</a>
    </Link>

    <List></List>
  </div>
);

export default Header;
